			9033: {"__id__": 9033, "cn": "若想让咱们的武将获得#cb历练提升#n，只有#cb征战#n才是唯一的选择！", "tw": "", "en": "" },
			9034: {"__id__": 9034, "cn": "首先，让我们选择#c089c1d魏国#n来征讨#cr蜀国#n的#cr阳平关#n吧", "tw": "", "en": "" },
			9035: {"__id__": 9035, "cn": "现在，请主公指派出征的武将吧", "tw": "", "en": "" },
			9036: {"__id__": 9036, "cn": "主公请看，将领下方的蓝色进度条代表#cr健康#n", "tw": "", "en": "" },
			9037: {"__id__": 9037, "cn": "征战玩法中，#cr被翻面的我方武将#n在对局结束时若未能翻回来，便会#cr扣减健康#n", "tw": "", "en": "" },
			9038: {"__id__": 9038, "cn": "当#cr健康减至0#n，武将便会#cr降级#n，甚至#cr濒死#n", "tw": "", "en": "" },
			9039: {"__id__": 9039, "cn": "所以主公，在征战过程中要时刻关注武将的健康状态", "tw": "", "en": "" },
			9040: {"__id__": 9040, "cn": "主公，我们已经成功的拿下了敌人的城池", "tw": "", "en": "" },
			9041: {"__id__": 9041, "cn": "可敌军也不是吃素的，在我们#c089c1d出征其它战线#n的时候，他们也可能#cr反扑#n", "tw": "", "en": "" },
			9042: {"__id__": 9042, "cn": "所以，防守工作也要做好，否则有可能前功尽弃", "tw": "", "en": "" },
			9043: {"__id__": 9043, "cn": "距离蜀国边塞第一关#cr阳平关#n，有2天路程。行军路上每天都会遇上一些#cr杂兵#n", "tw": "", "en": "" },
			9044: {"__id__": 9044, "cn": "只要拿下#cr阳平关#n，主公您的大业就向前迈出了第一步", "tw": "", "en": "" },
			9045: {"__id__": 9045, "cn": "以后主公每次#c089c1d出征结束时#n，#cr所有攻下的城池都会为您提供资源#n", "tw": "", "en": "" },
			9046: {"__id__": 9046, "cn": "所以，攻下的城池越多，每次出征结束就会获得越多的资源", "tw": "", "en": "" },
			9047: {"__id__": 9047, "cn": "点击驻防区，指派5名将领在此驻防吧", "tw": "", "en": "" },
