			9051: {"__id__": 9051, "cn": "现在我们选一张手牌放到战场上的美酒旁边，自然是选俺了", "tw": "", "en": "" },
			9052: {"__id__": 9052, "cn": "额，好吧。#cr雷击#n！小心#cr雷击#n，就是了", "tw": "", "en": "" },
			9053: {"__id__": 9053, "cn": "#c089c1d警戒#n可以让我对#cr之后#n放到自己相邻的敌军#cr发起进攻#n，是不是好diao", "tw": "", "en": "" },
			9054: {"__id__": 9054, "cn": "接下来双方轮流出牌，直到所有#cr格子放满#n时，如果我方的蓝色牌#c089c1d达到5张或更多#n，就算赢！", "tw": "", "en": "" },
