			9057: {"__id__": 9057, "cn": "还有，每次出征最好携带少量#cr粮草#n，那样的话途中失败后便拥有#c089c1d重新再来#n的机会", "tw": "", "en": "" },
			9058: {"__id__": 9058, "cn": "如果#cr战败时没了粮草#n，就只能强行#cr撤军#n了，撤军也是会#cr扣取全军健康#n的", "tw": "", "en": "" },
			9059: {"__id__": 9059, "cn": "现在我们来看看您已经获得的武将", "tw": "", "en": "" },
