			9062: {"__id__": 9062, "cn": "主公，您一定要经常留意武将的#cr健康#n，健康#cr降为0#n的话是会导致#cr降级#n或者#cr濒死#n的", "tw": "", "en": "" },
			9063: {"__id__": 9063, "cn": "所以在战斗结束前尽量把被翻面的武将#c089c1d翻回来#n，这点至关重要啊！", "tw": "", "en": "" },
