			9065: {"__id__": 9065, "cn": "啊哈哈，弱鸡，能不能派个像样的来？爷爷我完全没过到瘾！", "tw": "", "en": "" },
			9066: {"__id__": 9066, "cn": "身为堂堂主公，却要用来当诱饵。元直，你可不要卖我！", "tw": "", "en": "" },
			9067: {"__id__": 9067, "cn": "刘备小儿！你可识得我这阵法？！", "tw": "", "en": "" },
