			9092: {"__id__": 9092, "cn": "#cr主公、子龙可前往迎敌，只许败，不许胜#n", "tw": "", "en": "" },
			9093: {"__id__": 9093, "cn": "#cr我自带引火辎重，在最后一回合放火烧敌！#n", "tw": "", "en": "" },
