			9099: {"__id__": 9099, "cn": "知道啦知道啦，#cr等曹操大军展开，我就把他们全锁起来#n", "tw": "", "en": "" },
			9100: {"__id__": 9100, "cn": "曹贼！#cr到那时，我一把火便烧的你片甲不留#n！", "tw": "", "en": "" },
