			9125: {"__id__": 9125, "cn": "哎～若是奉孝还在，我何至于被杀成这狗样啊！", "tw": "", "en": "" },
			9126: {"__id__": 9126, "cn": "主公您先别说这些没用的，前面关二爷杵在那呢？", "tw": "", "en": "" },
