			9148: {"__id__": 9148, "cn": "待我军#cr战船将尔等冲入洪流，然后决堤#n，叫你们都成鱼鳖！", "tw": "", "en": "" },
			9149: {"__id__": 9149, "cn": "趁关羽在北边跟曹军打的火热，我们背后这刀一定要插的稳！准！狠！", "tw": "", "en": "" },
			9150: {"__id__": 9150, "cn": "都清楚了吧，你们#cr先潜伏在各个角落#n，切不可露出马脚", "tw": "", "en": "" },
			9151: {"__id__": 9151, "cn": "只听我号令，便一举#cr擒拿所有守卫，攻下烽火台#n！", "tw": "", "en": "" },
			9152: {"__id__": 9152, "cn": "荆州可不费一兵一卒便归我所有！", "tw": "", "en": "" },
			9153: {"__id__": 9153, "cn": "关将军，您已经插翅难飞了，这时候会不会后悔当初呢？", "tw": "", "en": "" },
			9154: {"__id__": 9154, "cn": "您女儿可是在家中等您回去呢？现在投降的话还不算晚呢", "tw": "", "en": "" },
			9155: {"__id__": 9155, "cn": "卑鄙无耻的东吴狗！城破，有死而已。爷做鬼也不会放过你！", "tw": "", "en": "" },
			9156: {"__id__": 9156, "cn": "子建，莫怪为兄无情，你说从小到大，为兄是不是什么都让着你？", "tw": "", "en": "" },
			9157: {"__id__": 9157, "cn": "可你却越来越放肆！先不说你跟你嫂嫂那点破事儿，如今连王位也要跟我抢", "tw": "", "en": "" },
			9158: {"__id__": 9158, "cn": "你有什么想说的没有？说完为兄送你上路", "tw": "", "en": "" },
			9159: {"__id__": 9159, "cn": "煮豆……燃……豆萁", "tw": "", "en": "" },
			9160: {"__id__": 9160, "cn": "豆在……釜中泣", "tw": "", "en": "" },
			9161: {"__id__": 9161, "cn": "本是……同根生", "tw": "", "en": "" },
			9162: {"__id__": 9162, "cn": "相煎……何……太……急", "tw": "", "en": "" },
			9163: {"__id__": 9163, "cn": "不灭东吴，誓不回蜀！", "tw": "", "en": "" },
			9164: {"__id__": 9164, "cn": "全军出击！", "tw": "", "en": "" },
			9165: {"__id__": 9165, "cn": "刘玄德不懂兵法，哪有连营七百里的搞法，简直蠢到家！", "tw": "", "en": "" },
			9166: {"__id__": 9166, "cn": "只消一把火，定叫蜀军首尾不能相顾，一触即溃！", "tw": "", "en": "" },
			9167: {"__id__": 9167, "cn": "幼常，这次我们来打这些蛮子，你有什么想法吗？", "tw": "", "en": "" },
			9168: {"__id__": 9168, "cn": "八个字。攻城为下，攻心为上！", "tw": "", "en": "" },
			9169: {"__id__": 9169, "cn": "若不能令这些蛮子彻底臣服，就算打下了一时，多半还是会反", "tw": "", "en": "" },
			9170: {"__id__": 9170, "cn": "嗯，有点意思，那孟获就交给你了", "tw": "", "en": "" },
			9171: {"__id__": 9171, "cn": "孔明，你既知天命，识时务，为何屡屡犯我疆界", "tw": "", "en": "" },
			9172: {"__id__": 9172, "cn": "你若降我魏国，大家从此吃香喝辣的，有什么不好？", "tw": "", "en": "" },
			9173: {"__id__": 9173, "cn": "哼！你丫世代身为汉朝老臣，理当安汉兴刘！", "tw": "", "en": "" },
			9174: {"__id__": 9174, "cn": "没想到国难之际，却毫无作为，反而助曹为虐，同谋篡位！", "tw": "", "en": "" },
			9175: {"__id__": 9175, "cn": "一辈子寸功未立，象条狗一样枉活了七八十岁！还敢在我面前狂吠！", "tw": "", "en": "" },
			9176: {"__id__": 9176, "cn": "我从未见过如此厚颜无耻之人！", "tw": "", "en": "" },
			9177: {"__id__": 9177, "cn": "诸葛村夫！你……你……啊……！", "tw": "", "en": "" },
			9178: {"__id__": 9178, "cn": "主公您看，由于攻下了阳平关和新野，现在已经有了少量的城池产出", "tw": "", "en": "" },
			9179: {"__id__": 9179, "cn": "在以后#cr每次出征结束时，后方城池都会产出一次资源#n", "tw": "", "en": "" },
			9180: {"__id__": 9180, "cn": "#cr随着您攻下的城池增多，每次产出的资源也会越来越多#n", "tw": "", "en": "" },
			9181: {"__id__": 9181, "cn": "有了关二爷的神威，我们去选择蜀国的征讨战线就会容易许多", "tw": "", "en": "" },
			9182: {"__id__": 9182, "cn": "后面的征途就全靠主公您自己了，记得经常回到演义玩法中获得新武将哦", "tw": "", "en": "" },
			9183: {"__id__": 9183, "cn": "喂喂，你们要不要这么配合他！", "tw": "", "en": "" },
			9184: {"__id__": 9184, "cn": "干得漂亮！主公，现在一鼓作气，去攻打#c089c1d吴国#n的#cr新野#n吧！", "tw": "", "en": "" },
			9185: {"__id__": 9185, "cn": "曹贼，哪里跑！", "tw": "", "en": "" },
			9186: {"__id__": 9186, "cn": "主公你快走，典韦来断后！", "tw": "", "en": "" },
			9187: {"__id__": 9187, "cn": "你们谁有胆子就过来！看清楚了，#cr威吓！来了就点数－1#n", "tw": "", "en": "" },
			9188: {"__id__": 9188, "cn": "曹公应趁早将他收入麾下。另外，您可别忘了答应我的事情啊", "tw": "", "en": "" },
			9189: {"__id__": 9189, "cn": "大哥你先别靠我太近，莫妨碍我使刀", "tw": "", "en": "" },
